@shibshib - correct, ideal scope would be changing of existing hyperparameters only, however it depends on if this is enough to disable recycle_register as well. If not, perhaps the introduction of hyperparameters for all subnets regarding disabling registrations (but there are further reaching consequences of that which may be undesirable).

As mentioned here (https://discord.com/channels/799672011265015819/1166513818957008936/1171858646712467526), I also agree that changing code for one subnet is not an ideal solution.

This is why one of the other proposals that I put forward (which would eliminate the need for SN13) was to integrate a community pool directly into SN0 - this would be fully decentralised from day-1, require no facilitator/intermediary, and be entirely managed by the senate (where in which the OTF could simply abstain on any votes therein relating to the community pool).

